int rek(int broj) {
    if(broj == 0) {
        return 0;
    }
    return rek(broj / 10) + 1;
}
int main(int argc, const char * argv[]) {
    int n;
    scanf("%d", &n);
    if(rek(n) % 2 == 0) {
        printf("1\n");
    }
    else {
        printf("0\n");
    }
    
    return 0;
}
