import javafx.scene.canvas.GraphicsContext;
import javafx.scene.paint.Color;
 
final int Y_OFFSET = 60;
 
private void drawBinaryTree(GraphicsContext gc, BinarySearchTree tree, double x, double y, double xOffset) {
    if (tree.isEmpty()) {
        return;
    }
 
    if (tree.getLeft() != null) {
        double xLeft = x - xOffset;
        double yLeft = y + Y_OFFSET;
        gc.setStroke(Color.BLACK);
        gc.strokeLine(x, y, xLeft, yLeft);
        drawBinaryTree(gc, tree.getLeft(), xLeft, yLeft, xOffset / 2);
    }
 
    double circleSize = 20;
    gc.setFill(Color.WHITE);
    gc.setStroke(Color.BLACK);
    gc.strokeOval(x - circleSize / 2, y - circleSize / 2, circleSize, circleSize);
    gc.fillText(tree.getData().toString(), x - 5, y + 5);
 
    if (tree.getRight() != null) {
        double xRight = x + xOffset;
        double yRight = y + Y_OFFSET;
        gc.setStroke(Color.BLACK);
        gc.strokeLine(x, y, xRight, yRight);
        drawBinaryTree(gc, tree.getRight(), xRight, yRight, xOffset / 2);
    }
}

