#include <bits/stdc++.h>

using namespace std;

const int N = 1e7 + 1;
const int INF = 1e9 + 7;

vector<int> c[N];

signed main() {
  ios_base::sync_with_stdio(false);
  cin.tie(NULL);
  cout.tie(NULL);
  int n, q;
  cin >> n >> q;
  vector<int> a;
  for (int i = 0; i < n; ++i) {
    int h;
    cin >> h;
    a.push_back(h);
  }
  sort(a.begin(), a.end());
  for (int i = 0; i < n; ++i) {
    c[a[i]].push_back(a[i]);
  }
  vector<int> f(N, 0);
  vector<int> num(N, 0);
  deque<pair<int, int>> b;
  for (int i = 0; i < n; ++i) {
    f[a[i]] = 0;
    b.push_back({0, a[i]});
  }
  for (int i = 1; i < N; ++i) {
    while(!c[i].empty()) {
      auto it = c[i][c[i].size() - 1];
      f[it] = i;
      b.push_back({i, it});
      if (i + it < N) {
        c[i + it].push_back(it);
      }
      c[i].pop_back();
    }
    while (b.front().first != f[b.front().second]) {
      b.pop_front();
    }
    num[i] = b.front().first;
  }
  vector<int> dp(N, 0);
  for (int i = 1; i < N; ++i) {
    if (num[i] == i) {
      dp[i] = INF;
      continue;
    }
    if (dp[num[i]] == INF) {
      dp[i] = INF;
      continue;
    }
    dp[i] = dp[num[i]] + 1;
  }
  for (int i = 0; i < q; ++i) {
    int h;
    cin >> h;
    if (dp[h] == INF) {
      cout << "oo\n";
      continue;
    }
    cout << dp[h] << '\n';
  }
  return 0;
}

